import React from 'react';
import { Form, FormControl, Button } from 'react-bootstrap'


class Dashboard extends React.Component {

  render(){
    return(
      <div>
        <h3>Create or enter a Game using a Game Number</h3>
        <Form className="mb-3" size="lg">
          <Form.Group>
            <FormControl sz="lg" placeholder="Enter Game Number"/>
            <Button type="button">Submit</Button>
          </Form.Group>
        </Form>
        <h3>Select an Avatar</h3>
        <Form className="mb-3" size="lg">
          <Form.Select>
            <Form.Option>choose me</Form.Option>
            <Form.Option>or me</Form.Option>
            <Form.Option>no me</Form.Option>
          </Form.Select>
        </Form>
      </div>
    )
  }


}

export default Dashboard;
